import React, { Component } from "react";
import logo from './logo.svg';
import './App.css';

class App extends Component {

    constructor(props) {
        super(props);

        this.state = {
            monsters: [
                {
                    name: "Nate"
                },
                {
                    name: "Stefan"
                },
                {
                    name: "Brate"
                }
            ]
        }
    }

    render() {
        return (
            <div className="App">
                {
                    this.state.monsters.map(monster => <h1>
                        {
                            monster.name
                        }
                    </h1>)
                }
            </div>
        );
    }
}

export default App;
